import React from 'react'
import style from 'styled-components'
import Header from '../components/header'
import Search from '../components/search'
import BgHeader from '../assets/img/color_draw.png'
class Navbar extends React.Component {
  constructor(props){
    super(props)    
      this.state={
        ItemSearched: []

      }
      this.myCallBackItemListening = this.myCallBackItemListening.bind(this)
}   

myCallBackItemListening(callback){
  this.setState({
    ItemSearched: callback
  })

}


  render() {
    const Wrapper = style.div`
    background-image: url(${BgHeader});
    background-repeat: no-repeat;
    background-position: center;
    background-size: 670px;
    padding-top: -50px;
    top: 0px;
    position: fixed;
    width: 100%;
    `

    const SpacePadding = style.div`
    padding-top: 10px;
    `


    return (
    <div>
    <Wrapper>
        <Header />
        <Search ItemSearched={this.myCallBackItemListening.bind(this)} />

    </Wrapper>  

    </div>
    );
  }
}

export default Navbar
